import React from "react";
interface Props {
    id: number;
    name: string;
    username: string;
}
export default function Quiz(props: Props) {
    const { id, name, username } = props

    function Click(event: React.EventHandler<Click>,id:number){
        console.log(id)
    }
    return (
        <div className="quiz-element cursor-pointer p-3" key={id} onClick={Click.bind(id)}>
            <div className="title">{name}</div>
            <div className="madeBy">By {username}</div>
        </div>
    );
}
